import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Produtos from './components/Produtos';
import Header from './components/Header';

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path="/" element={<Produtos />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
